import React, { useState } from 'react';
import { useData } from '../context/DataContext'; // Import the context hook
import { useNavigate } from 'react-router-dom';
import { HiMenu } from 'react-icons/hi'; // Import a hamburger icon from react-icons

const CompanyList = () => {
  const { companies } = useData(); // Get companies from context
  const navigate = useNavigate();
  const [isSidebarOpen, setIsSidebarOpen] = useState(false); // Handle sidebar state

  const handleCompanyClick = (companyId) => {
    navigate(`/shipments/${companyId}`);
  };

  return (
    <div className="flex bg-gray-100">
      {/* Sidebar Toggle Button */}
      <button
        className="md:hidden absolute top-4 left-4 z-50 bg-blue-600 text-white p-3 rounded-full shadow-lg hover:bg-blue-700 transition-colors"
        onClick={() => setIsSidebarOpen(!isSidebarOpen)} // Toggle sidebar open state
      >
        <HiMenu size={24} /> {/* Hamburger icon */}
      </button>

      {/* Sidebar */}
      <div className={`md:hidden fixed top-0 left-0 h-full w-64 bg-gray-800 text-white transition-transform transform ${isSidebarOpen ? 'translate-x-0' : '-translate-x-full'}`}>
        <div className="p-6">
          <h2 className="text-xl font-bold mb-6">Admin Dashboard</h2>
          <nav>
            <ul>
              <li className="mb-4">
                <a href="/companies" className="text-lg hover:text-gray-300">View Companies</a>
              </li>
              <li className="mb-4">
                <a href="/subscribers" className="text-lg hover:text-gray-300">View Subscribers</a>
              </li>
            </ul>
          </nav>
        </div>
      </div>

      {/* Main content */}
      <div className="min-h-screen bg-gradient-to-br from-blue-100 via-white to-blue-50 flex-1 p-8 ml-64">
        <h1 className="text-5xl font-bold text-center mb-12 text-gray-800 font-sans">Companies</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {companies.map((company) => (
            <div
              key={company.companyId}
              onClick={() => handleCompanyClick(company.companyId)}
              className="bg-white cursor-pointer border-l-4 border-blue-500 rounded-xl p-6 shadow-lg hover:shadow-2xl transition-shadow transform hover:-translate-y-1"
            >
              <h2 className="text-2xl font-semibold text-gray-800 mb-4">{company.name}</h2>
              <p className="text-sm text-gray-600 mb-2">
                <span className="font-medium text-gray-800">Registration Number:</span> {company.registrationNumber}
              </p>
              <p className="text-sm text-gray-600 mb-2">
                <span className="font-medium text-gray-800">Country of Incorporation:</span> {company.countryOfIncorporation.toUpperCase()}
              </p>
              <p className="text-sm text-gray-600 mb-2">
                <span className="font-medium text-gray-800">Business Type:</span> {company.businessType.replace('_', ' ')}
              </p>
              <p className="text-sm text-gray-600 mb-2">
                <span className="font-medium text-gray-800">Address:</span> {`${company.addressStreet} ${company.addressStreetNumber}, ${company.addressCity} ${company.addressZipCode}, ${company.addressCountry.toUpperCase()}`}
              </p>
              <p className="text-sm text-gray-600 mb-2">
                <span className="font-medium text-gray-800">Verified Date:</span> {new Date(company.verifiedDate).toLocaleDateString()}
              </p>
              <p className="text-sm text-gray-600">
                <span className="font-medium text-gray-800">Created At:</span> {new Date(company.createdAt).toLocaleDateString()}
              </p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CompanyList;
